import React from 'react';

const Settings = () => {
  function changeCSS () {
    var thisStyle = document.getElementById("theme");
    var newStyle = "App.css";
    if (thisStyle.getAttribute("href") == "App.css") {
        newStyle = "App2.css";
    }
    localStorage.setItem("current-style", newStyle);
    thisStyle.setAttribute("href", newStyle);
  }

  return (
    <div class="settings-page">
        <div class="company-section">
            <h1>Settings</h1>
            <body>
                Color Scheme:<button onClick={changeCSS}>change</button>
            </body>
        </div>
    </div>
  )
}

export default Settings
